import React from "react";
import { Container } from "react-bootstrap";
import Topbar from "./Navbar";
import "./style.css";


const Back = () => {
    return (
        <div className="cover">

            <Topbar />

            <Container style={{index: "-1", padding: "200pt"}}>
                <h1>Welcome</h1>
            </Container>

        </div>
    )
}

export default Back;
